function loadGithubCard(){document.querySelectorAll(".github-card").forEach((t=>{const e=t.getAttribute("data-github"),i=t.getAttribute("data-width"),r=t.getAttribute("data-height"),a=t.getAttribute("data-theme"),d=document.createElement("iframe");d.setAttribute("src",`mine/gh_pro.html?user=${e}&width=${i}&height=${r}&theme=${a}`),d.setAttribute("width",i),d.setAttribute("height",r),d.setAttribute("frameborder","0"),d.setAttribute("scrolling","no"),t.appendChild(d)}))}window.onload=loadGithubCard;